/* color conversion */
void rgb2ycrcb(struct ycrcb *ycrcb, struct argb888 *rgb, uint32_t size)
{
    for (uint32_t i = 0; i < size; ++i) {
        // Y = 0.299R + 0.587G + 0.114B
        ycrcb->_y[i] = (uint8_t)(0.299000 * rgb[i].r + 0.587000 * rgb[i].g + 0.114000 * rgb[i].b);
        // Cr = -0.168736R - 0.331264G + 0.500000B + 128
        ycrcb->cb[i] = (uint8_t)(-0.168736 * rgb[i].r - 0.331264 * rgb[i].g + 0.500000 * rgb[i].b + 128);
        // Cb = 0.500000R - 0.418688G - 0.081312B + 128
        ycrcb->cr[i] = (uint8_t)(0.500000 * rgb[i].r - 0.418688 * rgb[i].g - 0.081312 * rgb[i].b + 128);
    }
}

void ycrcb2rgb(struct ycrcb *ycrcb, struct argb888 *rgb, uint32_t size)
{
    for (uint32_t i = 0; i < size; ++i) {
        int r = (int)(ycrcb->_y[i] + 1.402000 * (ycrcb->cr[i] - 128));
        int g = (int)(ycrcb->_y[i] - 0.344136 * (ycrcb->cb[i] - 128) - 0.714136 * (ycrcb->cr[i] - 128));
        int b = (int)(ycrcb->_y[i] + 1.772000 * (ycrcb->cb[i] - 128));
        rgb[i].r = (r < 0) ? 0 : (r > 255) ? 255 : (uint8_t)r;
        rgb[i].g = (g < 0) ? 0 : (g > 255) ? 255 : (uint8_t)g;
        rgb[i].b = (b < 0) ? 0 : (b > 255) ? 255 : (uint8_t)b;
    }
}

/* down sampling */
void down_sampling(uint8_t *raw, uint16_t width, uint16_t height)
{
    uint16_t new_width = width / 2;
    uint16_t new_height = height / 2;

    for (uint8_t x = 0; x < new_height; ++x) {
        for (uint8_t y = 0; y < new_width; ++y) {
            raw[x * new_width + y] = (
                raw[(x * 2) * width + y * 2] +
                raw[(x * 2) * width + y * 2 + 1] +
                raw[(x * 2 + 1) * width + y * 2] +
                raw[(x * 2 + 1) * width + y * 2 + 1]
            ) / 4;
        }
    }
}

/* up sampling */
void up_sampling(uint8_t *raw, uint16_t width, uint16_t height)
{
    uint16_t new_width = width / 2;
    uint16_t new_height = height / 2;

    for (uint8_t x = new_height - 1; x > 0; --x) {
        for (uint8_t y = new_width - 1; y > 0; --y) {
            uint8_t val1 = raw[x * new_width + y];
            uint8_t val2 = raw[(x + 1) * new_width + y];
            uint8_t val3 = raw[x * new_width + y + 1];
            uint8_t val4 = raw[(x + 1) * new_width + y + 1];
            raw[(2 * x) * width + 2 * y]            = (val1 + val2 + val3 + val4) / 4;
            raw[(x * 2) * width + y * 2]            = (val1 + val2 + val3 + val4) / 4;
            raw[(x * 2) * width + y * 2 + 1]        = (val1 + val2 + val3 + val4) / 4;
            raw[(x * 2 + 1) * width + y * 2]        = (val1 + val2 + val3 + val4) / 4;
            raw[(x * 2 + 1) * width + y * 2 + 1]    = (val1 + val2 + val3 + val4) / 4;
        }
    }
}

